-- MEMS Sensor table creation
CREATE TABLE mems_table (
  id serial PRIMARY KEY,
  date_time timestamp without time zone NOT NULL,
  mems_date VARCHAR(255),
  mems_time VARCHAR(255),
  water_level double precision,
  voltage1 double precision,
  voltage2 double precision,
  current1 double precision,
  current2 double precision,
  frequency double precision,
  temperature double precision,
  humidity double precision,
  pressure double precision,
  slopex double precision,
  slopey double precision,
  slopez double precision,
  impactx double precision,
  impacty double precision,
  impactz double precision,
  impact_status VARCHAR (255)
);
